import React from "react";
import Layout from "../../components/Layout/Layouts";

const Dashboard = () => {
  return (
    <div>
      <Layout title={"Dashboard = Wellness Kitchen"}>
        <h1>Dashboard</h1>
      </Layout>
    </div>
  );
};

export default Dashboard;
